import React from "react";
import { Link } from "react-router-dom";
import { Nav } from "react-bootstrap";

const Sidebar = () => {
    return (
        <div className="sidebar">
            <Nav>
                <Link to="/">Inicio</Link>
                <Link to="/favorites">Favoritos</Link>
                <Link to="/profile">Perfil</Link>
            </Nav>
        </div>
    );
};

export default Sidebar;
